import { pageLinks } from './data';
import PageLink from './PageLink';

const PageLinks = ({ parentClass, itemClass }) => {
  return (
    <ul className={parentClass} id='nav-links'>
      {pageLinks.map((link) => {
        return (
          <PageLink
            key={link.id}
            parentClass={parentClass}
            itemClass={itemClass}
          />
        );
      })}
    </ul>
  );
};
export default PageLinks;
